<script>
    function update() {
        fetch('/api/house')
            .then(response => response.json())
            .then(data => {
                for (let i = 0; i < data.length; i++) {
                    let hasWinner = false;
                    let winner;
                    for (let q = 0; q < data[i].results.length; q++) {
                        if (data[i].results[q].isWinner == true) {
                            hasWinner = true;
                            winner = data[i].results[q];
                        }
                    }
                    if (hasWinner == false) {
                        if (data[i].districtNumber < 10) {
                            data[i].districtNumber = '0' + data[i].districtNumber;
                        }
                        if (document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "")) {
                            data[i].results = data[i].results.sort((a, b) => b.votes.count - a.votes.count);
                            if (data[i].results[0].partyName == "Democrat") {
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.fill = 'blue'
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.opacity = '0.4'
                            } else if (data[i].results[0].partyName == "Republican") {
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.fill = 'red'
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.opacity = '0.4'
                            }
                        }
                    } else {
                        if (data[i].districtNumber < 10) {
                            data[i].districtNumber = '0' + data[i].districtNumber;
                        }
                        console.log("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "");
                        if (document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "")) {
                            if (data[i].results[0].partyName == "Democrat") {
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.fill = 'blue'
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.opacity = '1'
                            } else if (data[i].results[0].partyName == "Republican") {
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.fill = 'red'
                                document.getElementById("" + data[i].stateCode.toUpperCase() + "-" + data[i].districtNumber + "").style.opacity = '1'
                            }
                        }
                    }
                }
            })
    }
    update();
    setInterval(update, 30000);
</script>
